function printBadge(barcode, first_name, last_name)
{
    try
    {
        // open label
        var labelXml = '<?xml version="1.0" encoding="utf-8"?>\
<DieCutLabel Version="8.0" Units="twips">\
<PaperOrientation>Landscape</PaperOrientation>\
<Id>NameBadgeCard</Id>\
<PaperName>30856 Badge Card Label - offset</PaperName>\
<DrawCommands>\
<Path>\
<FillMode>EvenOdd</FillMode>\
<Line X1="3509" Y1="0" X2="3509" Y2="6000" />\
            <LineTo X="517" Y="6000" />\
            <Arc CenterX="432" CenterY="6000" Radius="85" StartAngle="0" EndAngle="90" />\
            <LineTo X="0" Y="5915" />\
            <LineTo X="0" Y="85" />\
            <LineTo X="432" Y="85" />\
            <Arc CenterX="432" CenterY="0" Radius="85" StartAngle="-90" EndAngle="0" />\
            <LineTo X="3509" Y="0" />\
            <RoundRectangle X="2969" Y="2640" Width="180" Height="720" Rx="120" Ry="120" />\
        </Path>\
    </DrawCommands>\
    <ObjectInfo>\
        <TextObject>\
            <Name>NOMINATIVO</Name>\
            <ForeColor Alpha="255" Red="0" Green="0" Blue="0" />\
            <BackColor Alpha="0" Red="255" Green="255" Blue="255" />\
            <LinkedObjectName></LinkedObjectName>\
            <Rotation>Rotation0</Rotation>\
            <IsMirrored>False</IsMirrored>\
            <IsVariable>False</IsVariable>\
            <HorizontalAlignment>Center</HorizontalAlignment>\
            <VerticalAlignment>Middle</VerticalAlignment>\
            <TextFitMode>ShrinkToFit</TextFitMode>\
            <UseFullFontHeight>True</UseFullFontHeight>\
            <Verticalized>False</Verticalized>\
            <StyledText>\
              <Element>\
                <String>';
	var names = first_name + ' ' + last_name;
    label += names;
    label += '</String>\
                <Attributes>\
                  <Font Family="Trebuchet MS" Size="16" Bold="False" Italic="False" Underline="False" Strikeout="False" />\
                  <ForeColor Alpha="255" Red="0" Green="0" Blue="0" />\
                </Attributes>\
              </Element>\
            </StyledText>\
        </TextObject>\
        <Bounds X="450" Y="1529.5" Width="5175" Height="450" />\
    </ObjectInfo>\
    <ObjectInfo>\
      <BarcodeObject>\
        <Name>BARCODE</Name>\
        <ForeColor Alpha="255" Red="0" Green="0" Blue="0" />\
        <BackColor Alpha="0" Red="255" Green="255" Blue="255" />\
        <LinkedObjectName></LinkedObjectName>\
        <Rotation>Rotation0</Rotation>\
        <IsMirrored>False</IsMirrored>\
        <IsVariable>True</IsVariable><text>';
        label += barcode;
        label += '</text><Type>Ean13</Type>\
        <Size>Medium</Size>\
        <TextPosition>Bottom</TextPosition>\
        <TextFont Family="Arial" Size="8" Bold="False" Italic="False" Underline="False" Strikeout="False" />\
        <CheckSumFont Family="Arial" Size="8" Bold="False" Italic="False" Underline="False" Strikeout="False" />\
        <TextEmbedding>Full</TextEmbedding>\
        <ECLevel>0</ECLevel>\
        <HorizontalAlignment>Center</HorizontalAlignment>\
        <QuietZonesPadding Left="0" Top="0" Right="0" Bottom="0" />\
      </BarcodeObject>\
      <Bounds X="1102.5" Y="2384.99998474121" Width="3795" Height="955.52001953125" />\
    </ObjectInfo>\
    <ObjectInfo>\
      <ImageObject>\
        <Name>IMMAGINE</Name>\
        <ForeColor Alpha="255" Red="0" Green="0" Blue="0" />\
        <BackColor Alpha="0" Red="255" Green="255" Blue="255" />\
        <LinkedObjectName></LinkedObjectName>\
        <Rotation>Rotation0</Rotation>\
        <IsMirrored>False</IsMirrored>\
        <IsVariable>False</IsVariable>\
        <Image></Image>\
            <ScaleMode>Uniform</ScaleMode>\
            <BorderWidth>0</BorderWidth>\
            <BorderColor Alpha="255" Red="0" Green="0" Blue="0" />\
            <HorizontalAlignment>Center</HorizontalAlignment>\
            <VerticalAlignment>Center</VerticalAlignment>\
        </ImageObject>\
        <Bounds X="1552.5" Y="510" Width="2895" Height="795" />\
    </ObjectInfo>\
</DieCutLabel>';
	// label.setObjectText('names', names);
        // label.setObjectText("Barcode", barcode);
	var label = dymo.label.framework.openLabelXml(labelXml);
        // select printer to print on
        // for simplicity sake just use the first LabelWriter printer
        var printers = dymo.label.framework.getPrinters();
        if (printers.length == 0)
            throw "No DYMO printers are installed. Install DYMO printers.";	
        var printerName = "";
        for (var i = 0; i < printers.length; ++i)
        {
            var printer = printers[i];
            if (printer.printerType == "LabelWriterPrinter")
            {
                printerName = printer.name;
                break;
            }
        }      
        if (printerName == "")
            throw "No LabelWriter printers found. Install LabelWriter printer";
	
        // finally print the label
        label.print(printerName);
    }
    catch(e)
    {
        alert(e.message || e);
    }
};
